import React from 'react';
import { useNavigate } from 'react-router-dom';


const EmployeeList = () => {
  return (
    <div>
      <h1>Employee List</h1>
      <button onClick={() => navigate('/newemployee')}>Employee List</button>
    </div>
  );
};

export default EmployeeList;
